var letters = '0123456789ABCDEF';
var color = '#';
var F1PCC_slip = "slip: 0"
var connected = false;
var msg = {}
var current_color = $("#F1PCC")[0].style.fill
if (current_color == "green") {
    color = "red";
    F1PCC_slip = "slip: 1";
}
else {
    color = "green";
    connected = true;
    F1PCC_slip = "slip: 0";
}
$("#F1PCC")[0].style.fill = color;
$("#F1PCC_slip")[0].textContent = F1PCC_slip;


msg = {
    "color": color,
    "connected": connected,
    "F1PCC_slip": F1PCC_slip,
    "command": "F1PCC"
}

$scope.send({ payload: msg, topic: 'riaps/cmd' })

